window.bookSummaryJSON = "<p>Dorina Basarab is a dhampir - half-human, half-vampire. Subject to uncontrollable rages, most dhampirs live very short, very violent lives. So far Dory has managed to maintain her sanity by unleashing her anger on those demons and vampires who deserve killing.</p> <p>Now Dory's vampire father has come back into her life. Her uncle Dracula (yes, <i>the</i> Dracula), infamous even among vampires for his cruelty and murderous ways, has escaped his prison. And her father wants Dory to work with gorgeous master vampire Louis-Cesare to put him back there.</p> <p>Vampires and dhampirs are mortal enemies, and Dory prefers to work alone. But Dracula is the only thing on earth that truly scares her, so when Dory has to go up against him, she'll take all the help she can get….</p>"; 
